import React, { Component } from "react";
import "./App.css";
import { Navbar } from "./components/Navbar";
import { News } from "./components/News";
import { Routes, Route } from "react-router-dom";

export default class App extends Component {
  api_key = "585f3a3a24764a82a970c0f33e9b28ba";
  render() {
    return (
      <div>
        <Navbar />
        <Routes>
          <Route
            path="/"
            element={
              <News key="general" api_key={this.api_key} category="general" />
            }
          ></Route>
          <Route
            path="/business"
            element={
              <News key="business" api_key={this.api_key} category="business" />
            }
          ></Route>
          <Route
            path="/entertainment"
            element={
              <News
                key="entertainment"
                api_key={this.api_key}
                category="entertainment"
              />
            }
          ></Route>
          <Route
            path="/health"
            element={
              <News key="health" api_key={this.api_key} category="health" />
            }
          ></Route>
          <Route
            path="/science"
            element={
              <News key="science" api_key={this.api_key} category="science" />
            }
          ></Route>
          <Route
            path="/sports"
            element={
              <News key="sports" api_key={this.api_key} category="sports" />
            }
          ></Route>
          <Route
            path="/technology"
            element={
              <News
                key="technology"
                api_key={this.api_key}
                category="technology"
              />
            }
          ></Route>
        </Routes>
      </div>
    );
  }
}

